import { Quotes } from 'src/app/models/quotes.model';
import { Component } from '@angular/core';

@Component({
  selector: 'app-home',
  templateUrl: './home.component.html',
})
export class HomeComponent {
  quotes: Quotes = {
    id: '',
    author: '',
    tags: '',
    quote: ''
  }
}
